import React, { useState } from 'react';

const MembershipForm = () => {
  const [form, setForm] = useState({ 
    name: '', 
    email: '', 
    phone: '', 
    skills: '',
    experience: '',
    interests: '',
    message: '' 
  });

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const [status, setStatus] = useState('');

  const handleSubmit = async e => {
    e.preventDefault();
    setStatus('Sending...');
    try {
      const res = await fetch((process.env.REACT_APP_API_URL || 'http://localhost:5002/api') + '/membership', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(form)
      });
      if (res.ok) {
        setStatus('Welcome to I.D.C.! Check your email for next steps ‚úÖ');
        setForm({ name: '', email: '', phone: '', skills: '', experience: '', interests: '', message: '' });
      } else setStatus('Failed ‚ùå');
    } catch {
      setStatus('Error ‚ùå');
    }
  };

  return (
    <form className="membership-form" onSubmit={handleSubmit}>
      <h3>Join I.D.C. Community</h3>
      <p>Fill out this form to become a member of our developer community</p>
      
      <div className="form-row">
        <input 
          name="name" 
          placeholder="Full Name *" 
          value={form.name} 
          onChange={handleChange} 
          required 
        />
        <input 
          name="email" 
          type="email" 
          placeholder="Email Address *" 
          value={form.email} 
          onChange={handleChange} 
          required 
        />
      </div>
      
      <div className="form-row">
        <input 
          name="phone" 
          placeholder="Phone Number *" 
          value={form.phone} 
          onChange={handleChange} 
          required 
        />
        <select 
          name="experience" 
          value={form.experience} 
          onChange={handleChange} 
          required
        >
          <option value="">Experience Level *</option>
          <option value="student">Student</option>
          <option value="beginner">Beginner (0-1 years)</option>
          <option value="intermediate">Intermediate (1-3 years)</option>
          <option value="experienced">Experienced (3+ years)</option>
        </select>
      </div>
      
      <input 
        name="skills" 
        placeholder="Programming Languages/Skills (e.g., JavaScript, Python, React)" 
        value={form.skills} 
        onChange={handleChange} 
      />
      
      <select 
        name="interests" 
        value={form.interests} 
        onChange={handleChange}
      >
        <option value="">Primary Interest Area</option>
        <option value="web-development">Web Development</option>
        <option value="mobile-development">Mobile Development</option>
        <option value="data-science">Data Science & AI</option>
        <option value="cloud-devops">Cloud & DevOps</option>
        <option value="blockchain">Blockchain & Web3</option>
        <option value="cybersecurity">Cybersecurity</option>
        <option value="game-development">Game Development</option>
        <option value="other">Other</option>
      </select>
      
      <textarea 
        name="message" 
        placeholder="Tell us about yourself and why you want to join I.D.C. (optional)" 
        value={form.message} 
        onChange={handleChange} 
        rows="4"
      />
      
      <button type="submit" className="btn primary" disabled={status === 'Sending...'}>
        {status === 'Sending...' ? 'Joining...' : 'Join Community üöÄ'}
      </button>
      
      {status && <p className="form-status">{status}</p>}
    </form>
  );
};

export default MembershipForm;
